/* VCD dumping functions */
MOD_mkRouterTestBench & mkRouterTestBench_backing(tSimStateHdl simHdl)
{
  static MOD_mkRouterTestBench *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkRouterTestBench(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkRouterTestBench::dump_VCD_defs()
{
  (mkRouterTestBench_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkRouterTestBench::dump_VCD(tVCDDumpType dt)
{
  (mkRouterTestBench_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkRouterTestBench_backing(sim_hdl));
}
